  input: TEXT,SA11A1,SA11A1.66681,"On 12/20/06 we received a contribution from Dave
    Richter in the amount of $5,000 which was deposited into our federal account.  Five
    hundred dollars was transferred to our non-federal account, which can accept unlimited
    contributions from individuals, on 12/20/06.  A letter was sent to Dave Richter
    advising him of how is contribution was split into our accounts and to offer him
    a chance for a refund.  According to 2001-17, the Commission has deemed it sufficient
    to deposit checks that exceed the donor's federal limits into our federal account
    and then to make a transfer to the non-federal account for the portion that is
    over the federal limit.  Therefore, year to date aggregate totals reported by
    Dave Richter on our report is a reflection of the federal portion of the donor's
    contribution to date."
